import React from "react";
import Task from "./Todo";
const tasks = ({ tasks, onDelete }) => {
  return (
    <div className="todos">
      {tasks.map((task) => (
        <Task task={task} key={task.id} onDelete={onDelete} />
      ))}
    </div>
  );
};

export default tasks;
